import React from 'react';
import './App.css';

function App() {
  return (
      <div>
         <div><Header></Header></div>
             <div className="App">
                <ul>
                    <li>css</li>
                    <li>js</li>
                    <li>react</li>

                </ul>
            </div>
      </div>
  );
}

function Header() {
    return (
        <div>
            <a>Home</a>
            <a>News Feed</a>
            <a>Messages</a>

        </div>
    );
}

export default App;
